import React from 'react';
import ReactDom from 'react-dom';
import './index.css';
import App from './App';
import Stack from '@mui/material/Stack';
import CameraMaster from './Cameras';
import FaceMaster from './Recognition';
import OrgMaster from './Organization';
import AegisMaster from './Aegis';
import CSSTransitionGroup from 'react-transition-group/CSSTransitionGroup';
import {Route,Switch, BrowserRouter as Router} from 'react-router-dom';
import AdminMaster from './App';
import 'remixicon/fonts/remixicon.css'

function Main(){
  return(
    <div>
        <Links/>
        <Footer/>
    </div>
  )
}

function Links (){
  return(
  <div style={{padding: '25px'}}>
    <div style={{textAlign: 'right'}}>
    <i class="ri-user-line"></i>
    </div>
    <Stack direction="column" justifyContent="center" alignItems="flex-start">
    <div className="buttonParent">
    <p className="button"><a href="/App">Home</a></p>
    <p className="button"><a href="/Cameras">View Cameras</a></p>
    <p className="button"><a href="/Recognition">Face Recognition</a></p>
    <p className="button"><a href="/Organization">Manage Organization</a></p>
    <p className="button"><a href="/Aegis">Upgrade Aegis</a></p>
    </div>

    </Stack>
      <CSSTransitionGroup
        transitionName="example"
        transitionAppear={true}
        transitionAppearTimeout={500}
        transitionEnter={true}
        transitionLeave={true}>
        <Router>
          <Switch>
            <Route exact path="/" component={AdminMaster}/>
            <Route path="/App" component={AdminMaster}/>
            <Route path="/Cameras" component={CameraMaster}/>
            <Route path="/Recognition" component={FaceMaster}/>
            <Route path="/Organization" component={OrgMaster}/>
            <Route path="/Aegis" component={AegisMaster}/>
          </Switch>
        </Router>
      </CSSTransitionGroup>

  </div>
  )
}
function Footer(){
  return(
    <div class="footer">
      <Stack direction="row" justifyContent="center" alignItems="center" spacing={4}>
      <p><a href="contact@mayrealities.com">Contact Us</a></p>
      <p><a href="contact@mayrealities.com">Docs</a></p>
      </Stack>
    </div>
  )
}
export default App;
ReactDom.render(<Main/>,document.getElementById('root'))
